import React from 'react';
import { Button, Col } from 'react-bootstrap';

export default function Welcome() {
  return (
   <Col lg="4" className='bg-primary mt-2 mb-4 p-2 justify-content-center rounded text-center'>
        <h4>Bienvenido Gabriel</h4>
        <Button>Out</Button>
   </Col>
  )
}
